import * as React from 'react';
import { styled } from '@mui/system';
import { Tabs } from '@mui/base/Tabs';
import { TabsList as BaseTabsList } from '@mui/base/TabsList';
import { TabPanel as BaseTabPanel } from '@mui/base/TabPanel';
import { buttonClasses } from '@mui/base/Button';
import { Tab as BaseTab, tabClasses } from '@mui/base/Tab';
import { useTheme } from '@mui/material/styles';

export default function QuoteTabs() {
  const theme = useTheme(); // Get the current theme
  const isDarkMode = theme.palette.mode === 'dark'; // Determine if it's dark mode

  return (
    <Tabs defaultValue={1}>
      <TabsList isDarkMode={isDarkMode}>
        <Tab value={1}>One</Tab>
        <Tab value={2}>Two</Tab>
        <Tab value={3}>Three</Tab>
      </TabsList>
      <TabPanel value={1}>First page</TabPanel>
      <TabPanel value={2}>Second page</TabPanel>
      <TabPanel value={3}>Third page</TabPanel>
    </Tabs>
  );
}

// Define color palettes for both light and dark modes
const colors = {
  light: {
    tabBackground: '#FFFFFF',
    tabHover: '#111',
    tabSelected: '#dbd9d9',
    tabTextSelected: '#80BFFF',
    shadow: 'rgba(0, 0, 0, 0.2)',
  },
  dark: {
    tabBackground: '#1E1E1E',
    tabHover: '#333',
    tabSelected: '#444',
    tabTextSelected: '#80BFFF',
    shadow: 'rgba(0, 0, 0, 0.4)',
  },
};

// Styled components
const Tab = styled(BaseTab)`
  font-family: 'IBM Plex Sans', sans-serif;
  cursor: pointer;
  font-size: 0.875rem;
  font-weight: bold;
  background-color: transparent;
  width: 100%;
  line-height: 1.5;
  padding: 8px 12px;
  margin: 6px;
  border: none;
  border-radius: 8px;
  display: flex;
  justify-content: center;

  &:hover {
    background-color: ${({ theme }) =>
      theme.palette.mode === 'dark' ? colors.dark.tabHover : colors.light.tabHover};
  }

  &:focus {
    color: #fff;
    outline: 3px solid ${colors.light.tabHover};
  }

  &.${tabClasses.selected} {
    background-color: ${({ theme }) =>
      theme.palette.mode === 'dark' ? colors.dark.tabSelected : colors.light.tabSelected};
    color: ${({ theme }) =>
      theme.palette.mode === 'dark' ? colors.dark.tabTextSelected : colors.light.tabTextSelected};
  }

  &.${buttonClasses.disabled} {
    opacity: 0.5;
    cursor: not-allowed;
  }
`;

const TabPanel = styled(BaseTabPanel)`
  width: 100%;
  font-family: 'IBM Plex Sans', sans-serif;
  font-size: 0.875rem;
  padding: 16px;
  background-color: ${({ theme }) =>
    theme.palette.mode === 'dark' ? '#121212' : '#f5f5f5'};
  border-radius: 8px;
  box-shadow: 0 4px 6px
    ${({ theme }) =>
      theme.palette.mode === 'dark' ? colors.dark.shadow : colors.light.shadow};
`;

const TabsList = styled(BaseTabsList)(
  ({ isDarkMode }) => `
  min-width: 400px;
  background-color: ${isDarkMode ? colors.dark.tabBackground : colors.light.tabBackground};
  border-radius: 12px;
  margin-bottom: 16px;
  display: flex;
  align-items: center;
  place-content: space-between center;
  box-shadow: 0 4px 6px ${isDarkMode ? colors.dark.shadow : colors.light.shadow};
`,
);
